import React, { Component } from 'react'

class exemple extends Component {

    constructor(props) {
        super(props)

        this.state = {
            Fmessage: 'This is just practis',
            Smessage: `Don't worry`,
            Tmessage: 'Adil with you'
        }
        this.exempleFunc = this.exempleFunc.bind(this)
    }

    exempleFunc() {
        this.setState({
            Fmessage: '',
            Smessage: '',
            Tmessage: ''
        })
    }

    render() {
        return (
            <div>
                <h1 onClick={this.exempleFunc}></h1>
            </div>
        )
    }
}

export default testcomp
